.navbox.navbox .navbox-list > .navbox {
    margin: -0.25em -0.5em; /* Compensate for parent cell padding */
    border: none; /* Remove outer border on nested tables */
    box-shadow: none; /* Remove shadow from nested tables */
}

/* Styling for navbox-subgroup nested tables */
.navbox.navbox .navbox-subgroup {
    border-collapse: collapse;
    width: 100%;
    margin: 0;
    border: none;
    box-shadow: none;
}

/* Cells containing navbox-subgroup tables should have zero padding to eliminate cell-in-cell effect */
.navbox.navbox .navbox-parent {
    padding: 0 !important;
}

/* Group titles inside navbox-subgroup tables use same selective border pattern */
.navbox.navbox .navbox-subgroup .navbox-group-title {
    background: var(--navbox-group-title-background);
    text-align: left;
    padding: 0.25em 1em; /* Match web version padding */
    width: 1%;
    white-space: nowrap;
    border: 1px solid var(--navbox-border);
    border-width: 0 1px 1px 0; /* Right and bottom borders only - matches web version */
    font-weight: 600;
}

/* List cells inside navbox-subgroup tables - no bottom border to prevent doubling */
.navbox.navbox .navbox-subgroup .navbox-list {
    /* No bottom border to prevent doubling with row separators */
}

/* Row separators for subgroup tables - second row and beyond get top borders */
.navbox.navbox .navbox-subgroup tr:nth-child(n+2) {
    border-top: 1px solid var(--navbox-border);
}

